import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import BooksList from './BooksList';
import AddBookForm from './AddBookForm';
import BookDetails from './BookDetails';
import ProfileSection from './Profile';
import './Dashboard.css';

export const Dashboard = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [showProfile, setShowProfile] = useState(false);
  const [showAddBook, setShowAddBook] = useState(false);
  const [selectedBook, setSelectedBook] = useState(null);
  const [books, setBooks] = useState([]);

  useEffect(() => {
    const fetchUserProfile = async () => {
      try {
        const storedUser = JSON.parse(localStorage.getItem('user'));
        if (!storedUser?.email) {
          navigate('/login');
          return;
        }

        const response = await fetch(`http://localhost:8081/profile?email=${storedUser.email}`);
        const data = await response.json();
        
        if (data.success) {
          const updatedUser = { ...storedUser, ...data.profile };
          setUser(updatedUser);
          localStorage.setItem('user', JSON.stringify(updatedUser));
        } else {
          navigate('/login');
        }
      } catch (error) {
        console.error('Profile fetch error:', error);
        navigate('/login');
      }
    };

    const fetchBooks = async () => {
      try {
        const response = await fetch('http://localhost:8081/books');
        const data = await response.json();
        if (data.success) {
          setBooks(data.books);
        }
      } catch (error) {
        console.error('Error fetching books:', error);
      }
    };

    fetchUserProfile();
    fetchBooks();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleShowProfile = () => {
    setShowProfile(true);
    setShowAddBook(false);
    setSelectedBook(null);
  };

  const handleBackToDashboard = () => {
    setShowProfile(false);
    setShowAddBook(false);
    setSelectedBook(null);
  };

  const handleProfileUpdate = (updatedData) => {
    const updatedUser = { ...user, ...updatedData };
    setUser(updatedUser);
    localStorage.setItem('user', JSON.stringify(updatedUser));
  };

  const handleBookClick = (book) => {
    setSelectedBook(book);
    setShowProfile(false);
    setShowAddBook(false);
  };

  const handleAddBookSuccess = () => {
    setShowAddBook(false);
    fetch('http://localhost:8081/books')
      .then(res => res.json())
      .then(data => data.success && setBooks(data.books));
  };

  if (!user) {
    return <div className="dashboard-loading">Loading...</div>;
  }

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <div className="nav-brand">
          Welcome{user.firstName ? `, ${user.firstName}` : ''}!
        </div>
        <div className="nav-buttons">
          {!selectedBook && !showProfile && (
            <button 
              onClick={() => setShowAddBook(true)}
              className="nav-btn add-book-btn"
            >
              Add Book
            </button>
          )}
          <button 
            onClick={handleShowProfile} 
            className={`nav-btn profile-btn ${showProfile ? 'active' : ''}`}
          >
            Profile
          </button>
          <button onClick={handleLogout} className="nav-btn logout-btn">
            Logout
          </button>
        </div>
      </nav>

      <div className="dashboard-content">
        {showProfile ? (
          <ProfileSection 
            user={user} 
            onUpdate={handleProfileUpdate}
            onBack={handleBackToDashboard}
          />
        ) : showAddBook ? (
          <AddBookForm 
            onCancel={handleBackToDashboard}
            onSuccess={handleAddBookSuccess}
          />
        ) : selectedBook ? (
          <BookDetails 
            book={selectedBook} 
            onBack={handleBackToDashboard}
          />
        ) : (
          <div className="main-content">
            <BooksList 
              books={books} 
              onBookClick={handleBookClick}
            />
          </div>
        )}
      </div>
    </div>
  );
};
